import React from "react";
import {Nav, Navbar} from 'react-bootstrap';

class NaviBarComponent extends React.Component {
    render(){
        return (
            <Navbar bg="dark" variant="dark">
            <Navbar.Brand>
                Logo
            </Navbar.Brand>
    </Navbar>        
    )
    }
}

export {NaviBarComponent}
